import { Routes, Route } from "react-router-dom";
import { useState } from "react"
import Editor from "./Editor"
import Home from './Home';

function App() {
  const [docId, setDocId] = useState()

  const callback = (docId) => {
    setDocId(docId)
  }

  return (
    <div className="App">
      <Routes>
        <Route path="/" element={
        <Home
          callback={callback}
        />} />
        <Route path="/editor" element={
        <Editor
            id={docId}
        />} />
      </Routes>
    </div>
  );
}

export default App;
